        /// that are only reduced to a narrow uint hash at the very end instead of at every step.
        /// </summary>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint3 hashwide(Fp3x4 v)
        {
            return (asuint(v.c0) * uint3(0xBBCF63E7u, 0xC53F4755u, 0x6985C229u) +
                    asuint(v.c1) * uint3(0xE133B0B3u, 0xC3E0A3B9u, 0xFE31134Fu) +
                    asuint(v.c2) * uint3(0x712A34D7u, 0x9D77A59Bu, 0x4942CA39u) +
                    asuint(v.c3) * uint3(0xB40EC62Du, 0x565ED63Fu, 0x93C30C2Bu)) + 0xDCAF0351u;
        }

    }
}
